var a = [2, 4, 6, 8, 10];
var b = [1, 2, 5, 6, 9];
var dupNums = [];

// O(n)

var x = 0;
var y = 0;

while (x < a.length && y < b.length) {
  p1 = a[x];
  p2 = b[y];

  if (p1 < p2) {
    x++;
  } else if (p1 == p2) {
    dupNums.push(a[x]);
    x++
    y++
  } else {
    y++;
  }
  console.log(dupNums);
}
